	function loadData() {
		let storedData = localStorage.getItem(STORAGE_KEY);
		if (storedData) {
			dataCache = JSON.parse(storedData);
		} else {
			let processedData = DATA.map(item => ({
				...item,
				searchIndexOld: normalizeText(item.ten_cufull),
				searchIndexNew: normalizeText(item.ten_moifull)
			}));
			localStorage.setItem(STORAGE_KEY, JSON.stringify(processedData));
			dataCache = processedData;
		}
	}

	
	function searchData(targetInput, type) {
		let searchOld = document.getElementById(`searchOld_${type}`).value.trim().toLowerCase();
		let searchNew = document.getElementById(`searchNew_${type}`).value.trim().toLowerCase();

		if (!searchOld && !searchNew) {
			renderTable(dataCache.slice(0, 50), targetInput, 1, type);
			return;
		}

		let searchOldKeyword = normalizeText(searchOld);
		let searchNewKeyword = normalizeText(searchNew);

		let filtered = dataCache.map(item => {
			let score = 0;

			if (searchOld) {
				let scoreOld = calculateMatchScore(item.searchIndexOld, searchOldKeyword);
				score += scoreOld;
			}

			if (searchNew) {
				let scoreNew = calculateMatchScore(item.searchIndexNew, searchNewKeyword);
				score += scoreNew;
			}

			return { item, score };
		}).filter(entry => entry.score > 0)
			.sort((a, b) => b.score - a.score)
			.map(entry => entry.item);

		renderTable(filtered.slice(0, maxRows), targetInput, 1, type);
	}

	function calculateMatchScore(source, keyword) {
		if (!keyword) return 0;

		let score = 0;

		// Ưu tiên khớp chính xác cả cụm
		if (source.includes(keyword)) {
			let position = source.indexOf(keyword);
			score += 1000 - position; // Ưu tiên vị trí sớm
			if (position === 0) score += 100; // Ưu tiên nếu nằm đầu chuỗi
			if (source.match(new RegExp(`\\b${keyword}\\b`))) score += 100; // Ưu tiên cụm tách biệt
		}

		// Tính khớp từ liền nhau
		let sourceWords = source.split(' ');
		let keywordWords = keyword.split(' ');

		let foundConsecutive = false;

		for (let i = 0; i <= sourceWords.length - keywordWords.length; i++) {
			let matched = true;
			for (let j = 0; j < keywordWords.length; j++) {
				if (sourceWords[i + j] !== keywordWords[j]) {
					matched = false;
					break;
				}
			}
			if (matched) {
				foundConsecutive = true;
				break;
			}
		}

		if (foundConsecutive) {
			score += 300; // Ưu tiên cực mạnh khi các từ liền nhau
		} else {
			// Tính số từ khớp theo thứ tự nhưng không liền nhau
			let sourceIndex = 0, matchedCount = 0;

			for (let i = 0; i < keywordWords.length; i++) {
				let foundIndex = sourceWords.indexOf(keywordWords[i], sourceIndex);
				if (foundIndex >= 0) {
					matchedCount++;
					sourceIndex = foundIndex + 1;
				} else {
					break;
				}
			}

			score += matchedCount * 10;
		}

		return score;
	}
	


	function normalizeText(text) {
		return removeVietnameseTones(text)
			.toLowerCase()
			.replace(/[^a-z0-9\s]/g, ' ')
			.replace(/\s+/g, ' ')
			.trim();
	}

	function removeVietnameseTones(str) {
		return str.normalize('NFD').replace(/\p{Diacritic}/gu, '').replace(/\u0111/g, 'd').replace(/\u0110/g, 'D');
	}

