	function renderTable(data, targetInput, page, type) {
		let tableBody = document.getElementById(`resultTable_${type}`);
		tableBody.innerHTML = '';

		let start = (page - 1) * rowsPerPage;
		let end = Math.min(start + rowsPerPage, data.length);

		for (let i = start; i < end; i++) {
			let item = data[i];
			let row = document.createElement('tr');

			let cellNew = document.createElement('td');
			let cellOld = document.createElement('td');

			cellNew.textContent = item.ten_moifull;
			cellOld.textContent = item.ten_cufull;

			row.appendChild(cellNew);
			row.appendChild(cellOld);

			row.style.transition = 'background-color 0.3s';
			row.addEventListener('mouseover', () => {
				row.style.backgroundColor = '#e0f0ff';
				row.style.cursor = 'pointer';
			});
			row.addEventListener('mouseout', () => {
				row.style.backgroundColor = '';
			});

			row.addEventListener('click', () => {
				let currentValue = targetInput.value.trim();
				let appendText = `, ĐC mới ${item.ten_moifull} (ĐC cũ ${item.ten_cufull})`;

				let newValue = '';
				if (currentValue.includes(', ĐC mới')) {
					newValue = currentValue.replace(/, ĐC mới .*?\(ĐC cũ .*?\)/, appendText);
				} else {
					newValue = currentValue ? `${currentValue} ${appendText}` : appendText;
				}

				let nativeInputValueSetter = Object.getOwnPropertyDescriptor(window.HTMLInputElement.prototype, 'value').set;
				nativeInputValueSetter.call(targetInput, newValue);

				let event = new Event('input', { bubbles: true });
				targetInput.dispatchEvent(event);

				let overlay = document.getElementById(`popupOverlay_${type}`);
				if (overlay) document.body.removeChild(overlay);

				let nextSearchBtn = targetInput.nextElementSibling;
				if (nextSearchBtn && nextSearchBtn.tagName === 'BUTTON') {
					nextSearchBtn.click();
				}
			});

			tableBody.appendChild(row);
		}

		renderPagination(data, targetInput, page, type);
	}

	function renderPagination(data, targetInput, currentPage, type) {
		let paginationDiv = document.getElementById(`pagination_${type}`);
		paginationDiv.innerHTML = '';

		let totalPages = Math.ceil(data.length / rowsPerPage);

		for (let i = 1; i <= totalPages; i++) {
			let pageButton = document.createElement('button');
			pageButton.textContent = i;
			pageButton.style.margin = '0 5px';
			pageButton.style.padding = '5px 10px';
			pageButton.disabled = (i === currentPage);

			pageButton.addEventListener('click', () => {
				renderTable(data, targetInput, i, type);
			});

			paginationDiv.appendChild(pageButton);
		}
	}

	function observeInput() {
		const observer = new MutationObserver(() => {
			const customerInput = document.getElementById('customerAddress');
			const receiverInput = document.getElementById('receiverAddress');

			if (customerInput && !customerInput.parentNode.querySelector('#customBtn_customer')) {
				createButton(customerInput, 'customer');
			}

			if (receiverInput && !receiverInput.parentNode.querySelector('#customBtn_receiver')) {
				createButton(receiverInput, 'receiver');
			}
		});

		observer.observe(document.body, { childList: true, subtree: true });
	}

	window.onload = function () {
		loadData();
		observeInput();
	}
